import React from "react";

export default class Video extends React.Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        const url = require('../../media/gaoxiao.mp4')
        return (
            <div style={{width: '90%', height: '600px'}}>
                <video style={{margin: '0 auto'}} src={url.default} controls='controls' />
            </div>
        )
    }
}
